(1, 'aboutus', 'HIMIK', '<h3 style=\"text-align: center;\"><font color=\"#000000\" face=\"Comic Sans MS\">PROFIL </font><font face=\"Comic Sans MS\" color=\"#0000ff\">HIMIK</font></h3><h4><font color=\"#000000\" face=\"Comic Sans MS\">HIMIK merupakan salah satu Himpunan Mahasiswa Jurusan Ilmu Komputer (HIMIK) yang ada di Universitas Muhammadiyah Bangka Belitung. HIMIK berdiri pada tanggal tahun 2020 . HIMIK merupakan Himpunan Mahasiswa yang terdiri dari jurusan falkultas teknik dan sains yaitu Ilmu Komputer.&nbsp;</font></h4><h4><font color=\"#000000\" face=\"Comic Sans MS\"><br><br>1.Sebagai wadah untuk pengembangan daya fikir, kreatifitas serta minat dan bakat dari mahasiswa/i&nbsp;<br>2.Untuk membina hubungan silahturahim antara mahasiswa manajemen Informatika dan Sistem Informasi&nbsp;</font></h4><h4><font color=\"#000000\" face=\"Comic Sans MS\"><br></font></h4><h2 style=\"text-align: center; \"><font color=\"#000000\" face=\"Comic Sans MS\"><span style=\"background-color: rgb(255, 255, 0);\">VISI</span>\r\n&amp; <span style=\"background-color: rgb(107, 173, 222);\">MISI</span></font></h2><h4><p style=\"language:en-US;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-align:center;direction:ltr;unicode-bidi:embed;mso-line-break-override:\r\nnone;word-break:normal;punctuation-wrap:hanging\"></p><p style=\"text-align: center; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; word-break: normal;\"></p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; word-break: normal;\"></p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; word-break: normal;\"></p></h4><h3 style=\"text-align: center; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; word-break: normal;\"><font style=\"background-color: rgb(247, 247, 247);\" color=\"#000000\" face=\"Comic Sans MS\">VISI&nbsp; :</font></h3><h5 style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; word-break: normal;\"><font face=\"Comic Sans MS\">Menjadikan HIMIK sebagai wadah Mahasiswa Sistem Informasi yang memiliki kekeluargaan yang kuat, kreatif, dan inovatif serta memiliki jiwa Enterpeneur dan kapabilitas baik dalam bidang ilmu dan teknologi.</font></h5><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; word-break: normal;\"></p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; word-break: normal;\"></p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; word-break: normal;\"></p><p style=\"text-align: center; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; word-break: normal;\"></p><h3 style=\"text-align: center; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; word-break: normal;\"><font color=\"#000000\" face=\"Comic Sans MS\" style=\"background-color: rgb(247, 247, 247);\">MISI&nbsp; :</font></h3><div class=\"O0\" style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0.38in; direction: ltr; unicode-bidi: embed; word-break: normal;\"><font face=\"Comic Sans MS\">1.Meningkatkan Kapabilitas dibidang ilmu dan teknologi.</font></div><div class=\"O0\" style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0.38in; direction: ltr; unicode-bidi: embed; word-break: normal;\"><font face=\"Comic Sans MS\">2.Menciptakan Mahasiswa/I yang memliki jiwa Enterpenuer yang tinggi di bidang IT.</font></div><div class=\"O0\" style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0.38in; direction: ltr; unicode-bidi: embed; word-break: normal;\"><font face=\"Comic Sans MS\">3.Menciptakan Mahasiswa/I yang kreatif dan Inovatif.</font></div><div class=\"O0\" style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0.38in; direction: ltr; unicode-bidi: embed; word-break: normal;\"><font face=\"Comic Sans MS\">4.Menjalin kekeluargaan antar Mahasiswa/I, Dosen, dan Kaprodi.</font></div><div class=\"O0\" style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0.38in; direction: ltr; unicode-bidi: embed; word-break: normal;\"><span style=\"font-family: &quot;Comic Sans MS&quot;;\">5.Melanjutkan Proker yang belum terlaksana di tahun sebelumnya.</span></div><div class=\"O0\" style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0.38in; direction: ltr; unicode-bidi: embed; word-break: normal;\"><font face=\"Comic Sans MS\"><div><br></div></font></div><h2 style=\"text-align: center; \"><br></h2>', '2018-06-30 18:01:03', '2024-01-14 15:42:41'),
