(14, 'Seminar Multimedia', 8, 10, '<p style=\"margin-bottom: 15px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; font-size: 13px; line-height: inherit; font-family: Roboto, Arial, Tahoma, sans-serif; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; color: rgb(98, 98, 98); background-color: rgb(252, 252, 252);\"><br class=\"Apple-interchange-newline\"></p><div class=\"note-control-holder note-control-nw\" style=\"box-sizing: border-box; outline: none !important; position: absolute; width: 7px; height: 7px; border-width: 1px 0px 0px 1px; border-top-style: solid; border-right-style: initial; border-bottom-style: initial; border-left-style: solid; border-top-color: black; border-right-color: initial; border-bottom-color: initial; border-left-color: black; border-image: initial; top: -5px; left: -5px; color: rgb(121, 121, 121); font-family: &quot;Varela Round&quot;, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"></div><p style=\"margin-bottom: 15px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; font-size: 13px; line-height: inherit; font-family: Roboto, Arial, Tahoma, sans-serif; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; color: rgb(98, 98, 98); background-color: rgb(252, 252, 252);\"><br class=\"Apple-interchange-newline\">Menyadari pentingnya langkah dan teori sebelum mengambil potret gambar, tentunya berguna&nbsp; bagi kepentingan-kepentingan digital saat ini seperti konten media sosial, iklan penjualan, dokumentasi kegiatan, dan berbagai kepentingan digital lainnya. Oleh karena itu, Himpunan Mahasiswa Ilmu Komputer Universitas Muhammadiyah Bangka Belitung menjadi wadah untuk memberi pemahaman mengenai permasalahan seputar dalam mengambil potret gambar.<br class=\"Apple-interchange-newline\"></p><p><span style=\"background-color: rgb(252, 252, 252); color: rgb(98, 98, 98); font-family: Roboto, Arial, Tahoma, sans-serif; font-size: 13px;\">Himik Unmuh Babel mengadakan kegiatan Semina</span><span style=\"background-color: rgb(252, 252, 252); color: rgb(98, 98, 98); font-family: Roboto, Arial, Tahoma, sans-serif; font-size: 13px;\">r Multimedia dengan tema Bertutur dalam Gambar, Jum’at (22/07/2022). Seminar Multimedia dibuka </span><span style=\"background-color: rgb(252, 252, 252); color: rgb(98, 98, 98); font-family: Roboto, Arial, Tahoma, sans-serif; font-size: 13px;\">Langsung oleh Dekan Fakultas Teknik dan Sains yaitu Bapak Ilpandari, S.T., M.T. “Seminar ini sangat bagus dan bermanfaat terutama bagi generasi-generasi milenial saat ini, mengolah konten kita tanpa harus mengedit terlebih dahulu”, ujar Dekan FTS Unmuh Babel tersebut. Adapun narasumber yang mengisi kegiatan ini adalah Bapak Yudi Noviandi, ST.. Beliau seorang Ketua Assosiasi Profesi Fotografi Indonesia Pengda Babel sekaligus Founder Babel Cinematography Comunity, Founder Fotografer Babel Islands, dan kerap menjadi juri dalam ajang perlombaan film. Tentunya berpengalaman dalam bidangnya serta tema yang dibahas pada webinar tersebut.</span><img src=\"data:image/png;base64,\" data-filename=\"Screenshot (286).png\" style=\"width: 271.664px; height: 180.062px;\"><br></p>', '2019-03-25', '2024-01-08 00:04:34', 1, 'Seminar-Multimedia', '0c14c838abee82e334edb3314b4bfaa3.png', 1);
