(15, 'Musyawarah Besar II Tahun 2022', 9, 0, '<p style=\"margin-bottom: 15px; line-height: inherit; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; font-size: 13px; font-family: Roboto, Arial, Tahoma, sans-serif; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; color: rgb(98, 98, 98); background-color: rgb(252, 252, 252);\">Musyawarah Besar adalah salah suatu agenda yang wajib dilaksanakan dari setiap organisasi yang ada. Agenda Musyawarah Besar (Mubes) membahas laporan pertanggung jawaban kepengurusan sebelumnya, Anggaran Dasar dan Anggaran Rumah Tangga suatu organisasi sekaligus memilih dan menentukan pemimpin baru untuk memimpin sebuah organisasi. Oleh karena itu, Mubes adalah suatu agenda yang sakral dari sebuah organisasi seperti halnya yang telah disampaikan oleh Kepala Program Studi Ilmu Komputer dalam sambutannya, Ibu Eka Altiarika, S.Kom., M.Eng, Jum’at (04/08/2022).</p><p style=\"margin-bottom: 15px; line-height: inherit; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; font-size: 13px; font-family: Roboto, Arial, Tahoma, sans-serif; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; color: rgb(98, 98, 98); background-color: rgb(252, 252, 252);\">Himpunan Mahasiswa Ilmu Komputer&nbsp; (HIMIK) Universitas Muhammadiyah Bangka Belitung mengadakan Musyawarah Besar II tahun kepengurusan 2021/2022 yang diikuti seluruh&nbsp; Mahasiswa Prodi Ilmu Komputer dan tamu undangan yang terdiri dari Bapak / Ibu Dekan Fakultas Teknik dan Sains, Kepala Program Studi Ilmu Komputer, Dosen Prodi Ilmu Komputer serta Ketua Himpunan dari berbagai Prodi di Universitas Muhammadiyah Bangka Belitung.</p><p style=\"margin-bottom: 15px; line-height: inherit; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; font-size: 13px; font-family: Roboto, Arial, Tahoma, sans-serif; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; color: rgb(98, 98, 98); background-color: rgb(252, 252, 252);\">Musyawarah Besar II Himpunan Mahasiswa Ilmu Komputer (HIMIK) mengangkat tema Regenerasi Kepemimpinan dalam Mewujudkan Kepengurusan yang Berintegritas. Seperti halnya dengan tema&nbsp; yang telah di tetapkan, Musyawarah Besar II kali ini mendapatkan dua nama yang terpilih sebagai Ketua dan Wakil Ketua dari dua Pasangan Calon yang diusulkan oleh Mahasiswa Ilmu Komputer Universitas Muhammadiyah Bangka Belitung.</p><p style=\"margin-bottom: 15px; line-height: inherit; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; font-size: 13px; font-family: Roboto, Arial, Tahoma, sans-serif; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; color: rgb(98, 98, 98); background-color: rgb(252, 252, 252);\">Pasangan calon nomor urut 2 Randi Atul Aufa dan Ari Ardiansyah yang ditetapkan sebagai Ketua dan Wakil Ketua Himpunan Mahasiswa Ilmu Komputer (HIMIK) Universitas Muhammadiyah Bangka Belitung tahun kepengurusan 2022/2023. Mengalahkan pasangan calon nomor urut 1 dengan selisih satu suara. Kepala Program Studi Ilmu Komputer Universitas Muhammadiyah Bangka Belitung sangat berharap dengan adanya regenerasinya kepengurusan yang baru tentunya dapat membawa kemajuan dan perubahan baik bagi Himpunan maupun Program Studi, harapannya untuk semua mahasiswa Ilmu Komputer dapat lebih aktif lagi di berbagai bidang melalui wadahnya yaitu Himpunan Mahasiswa Ilmu Komputer,&nbsp; demikian pidato penutup yang disampaikan Ibu Eka Altiarika, S.Kom., M.Eng.</p>', '2019-04-17', '2024-01-08 00:09:39', 1, 'Musyawarah-Besar-II-Tahun-2022', '0c14c838abee82e334edb3314b4bfaa3.png', 2),
