erit; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline;\">“&nbsp;</em></span><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline;\">Menjadi program studi yang unggul dalam bidang sistem cerdas (<em style=\"margin: 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline;\">intelligent system</em>) dan sains data (<em style=\"margin: 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline;\">data science</em>) di tingkat nasional pada tahun 2034&nbsp;</span><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline;\"><em style=\"margin: 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline;\">”</em></span></p><p style=\"margin-bottom: 15px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; font-size: 13px; line-height: inherit; font-family: Roboto, Arial, Tahoma, sans-serif; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; color: rgb(98, 98, 98); background-color: rgb(252, 252, 252);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline;\"><em style=\"margin: 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline;\">&nbsp;</em></span></p><h3 style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; font-size: 25px; line-height: 27px; font-family: &quot;Patua One&quot;, Arial, Tahoma, sans-serif; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; color: rgb(68, 68, 68); background-color: rgb(252, 252, 252);\"><a name=\"_Toc56446\" style=\"margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; outline-style: initial; outline-width: 0px; color: rgb(68, 68, 68);\"></a><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline;\">Misi</span></h3><ol style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 30px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; font-size: 13px; line-height: inherit; font-family: Roboto, Arial, Tahoma, sans-serif; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; list-style-position: initial; list-style-image: initial; color: rgb(115, 126, 134); background-color: rgb(252, 252, 252);\"><li style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\">Menyelenggarakan pendidikan bidang ilmu komputer berbasis riset dibidang sistem cerdas (intelligent system) dan sains data (data science) untuk mendukung lingkungan yang profesional, intelektual, dan bernilai islami.</li><li style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\">Menyelenggarakan penelitian berkualitas berbasis sistem cerdas (intelligent system) dan sains data (data science) yang kompetitif dan memiliki daya saing di tingkat nasional.</li><li style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\">Mengimplementasikan hasil riset dalam bentuk kegiatan pengabdian kepada masyarakat sebagai bentuk kontribusi implementasi untuk kemaslahatan umat.</li><li style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\">Menyelenggarakan tata kelola akademik dan non-akademik yang transparan, efisien dan produktif.</li><li style=\"margin: 0px 0px 10px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\">Menjalin kerja sama dalam upaya meningkatkan mutu program dan kegiatan akademik yang berkelanjutan di tingkat lokal dan nasional.</li></ol>', '2019-05-10', '2024-01-07 23:37:13', 1, 'Visi-dan-Misi-Program-Studi-Ilmu-Komputer', 'eb794ae987d1128ce694b5d9e2f6abdc.png', 1),
(21, 'Pertandingan Futsal HIMIK', 9, 0, '<div><span style=\"font-size: 14px;\">Pertandingan futsal yang diikuti oleh Himpunan Mahasiswa Ilmu Komputer (HIMIK) merupakan salah satu acara yang sangat dinantikan oleh seluruh anggota himpunan. Sejak beberapa minggu sebelumnya, panitia telah bekerja keras untuk mempersiapkan segala sesuatu agar acara ini berjalan lancar dan meriah.</span></div><div><span style=\"font-size: 14px;\">Hari pertandingan tiba, dan lapangan futsal yang biasa digunakan oleh mahasiswa diubah menjadi arena yang penuh semangat. Bendera-bendera berwarna-warni berkibar di sekeliling lapangan, menciptakan atmosfer yang membangkitkan semangat kompetisi. Suasana kebersamaan dan kegembiraan terasa begitu kental di antara para peserta dan penonton.</span></div><div><span style=\"font-size: 14px;\"><br></span></div><div><span style=\"font-size: 14px;\">Tim-tim futsal dari berbagai angkatan di HIMIK telah melakukan persiapan matang. Mereka berlatih secara intensif, merancang strategi permainan, dan memilih formasi terbaik untuk meraih kemenangan. Setiap tim membawa semangat persaudaraan dan keinginan kuat untuk membuktikan kebolehan mereka di atas lapangan.</span></div><div><span style=\"font-size: 14px;\">Seiring dengan berjalannya waktu, pertandingan demi pertandingan berlangsung dengan penuh semangat. Pemain-pemain HIMIK menunjukkan keterampilan teknis, kecepatan, dan kerjasama tim yang luar biasa. Penonton berteriak-teriak memberikan dukungan kepada tim favorit mereka, menciptakan sorak sorai yang menggema di seluruh lapangan.</span></div><div><span style=\"font-size: 14px;\">Tidak hanya para pemain, tetapi juga panitia penyelenggara memberikan kontribusi besar untuk kesuksesan acara ini. Mereka bekerja keras menjaga kelancaran jalannya pertandingan, menyajikan hiburan di sela-sela waktu istirahat, dan mengabadikan momen-momen epik dalam pertandingan melalui dokumentasi yang apik.</span></div><div><span style=\"font-size: 14px;\">Setelah berbagai pertandingan sengit, akhirnya tiba saat penentuan. Tim-tim terbaik HIMIK yang berhasil mencapai babak final bersaing untuk meraih gelar juara. Pertandingan final menjadi puncak dari semua usaha dan perjuangan yang telah dilakukan oleh setiap tim. Semangat persaingan dan kebersamaan menjadi elemen utama yang menciptakan nuansa yang tak terlupakan.</span></div><div><br></div>', '2019-05-10', '2024-01-15 03:34:20', 0, 'Pertandingan-Futsal-HIMIK', 'eb3cdcf74d2876073a07643759011d8fjpeg', 1),
(23, 'Musyawarah Besar II Tahun 2022', 9, 0, '<p style=\"margin-bottom: 15px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; font-size: 13px; line-height: inherit; font-family: Roboto, Arial, Tahoma, sans-serif; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; color: rgb(98, 98, 98); background-color: rgb(252, 252, 252);\">Musyawarah Besar adalah salah suatu agenda yang wajib dilaksanakan dari setiap organisasi yang ada. Agenda Musyawarah Besar (Mubes) membahas laporan pertanggung jawaban kepengurusan sebelumnya, Anggaran Dasar dan Anggaran Rumah Tangga suatu organisasi sekaligus memilih dan menentukan pemimpin baru untuk memimpin sebuah organisasi. Oleh karena itu, Mubes adalah suatu agenda yang sakral dari sebuah organisasi seperti halnya yang telah disampaikan oleh Kepala Program Studi Ilmu Komputer dalam sambutannya, Ibu Eka Altiarika, S.Kom., M.Eng, Jum’at (04/08/2022).</p><p style=\"margin-bottom: 15px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; font-size: 13px; line-height: inherit; font-family: Roboto, Arial, Tahoma, sans-serif; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; color: rgb(98, 98, 98); background-color: rgb(252, 252, 252);\">Himpunan Mahasiswa Ilmu Komputer&nbsp; (HIMIK) Universitas Muhammadiyah Bangka Belitung mengadakan Musyawarah Besar II tahun kepengurusan 2021/2022 yang diikuti seluruh&nbsp; Mahasiswa Prodi Ilmu Komputer dan tamu undangan yang terdiri dari Bapak / Ibu Dekan Fakultas Teknik dan Sains, Kepala Program Studi Ilmu Komputer, Dosen Prodi Ilmu Komputer serta Ketua Himpunan dari berbagai Prodi di Universitas Muhammadiyah Bangka Belitung.</p><p style=\"margin-bottom: 15px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; font-size: 13px; line-height: inherit; font-family: Roboto, Arial, Tahoma, sans-serif; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; color: rgb(98, 98, 98); background-color: rgb(252, 252, 252);\">Musyawarah Besar II Himpunan Mahasiswa Ilmu Komputer (HIMIK) mengangkat tema Regenerasi Kepemimpinan dalam Mewujudkan Kepengurusan yang Berintegritas. Seperti halnya dengan tema&nbsp; yang telah di tetapkan, Musyawarah Besar II kali ini mendapatkan dua nama yang terpilih sebagai Ketua dan Wakil Ketua dari dua Pasangan Calon yang diusulkan oleh Mahasiswa Ilmu Komputer Universitas Muhammadiyah Bangka Belitung.</p><p style=\"margin-bottom: 15px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; font-size: 13px; line-height: inherit; font-family: Roboto, Arial, Tahoma, sans-serif; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; color: rgb(98, 98, 98); background-color: rgb(252, 252, 252);\">Pasangan calon nomor urut 2 Randi Atul Aufa dan Ari Ardiansyah yang ditetapkan sebagai Ketua dan Wakil Ketua Himpunan Mahasiswa Ilmu Komputer (HIMIK) Universitas Muhammadiyah Bangka Belitung tahun kepengurusan 2022/2023. Mengalahkan pasangan calon nomor urut 1 dengan selisih satu suara. Kepala Program Studi Ilmu Komputer Universitas Muhammadiyah Bangka Belitung sangat berharap dengan adanya regenerasinya kepengurusan yang baru tentunya dapat membawa kemajuan dan perubahan baik bagi Himpunan maupun Program Studi, harapannya untuk semua mahasiswa Ilmu Komputer dapat lebih aktif lagi di berbagai bidang melalui wadahnya yaitu Himpunan Mahasiswa Ilmu Komputer,&nbsp; demikian pidato penutup yang disampaikan Ibu Eka Altiarika, S.Kom., M.Eng.</p>', '2019-05-12', '2024-01-15 03:34:49', 0, 'Musyawarah-Besar-II-Tahun-2022', '0c14c838abee82e334edb3314b4bfaa3.png', 2),
(24, 'Seminar Multimedia', 9, 0, '<p style=\"margin-bottom: 15px; padding: 0px; color: rgb(98, 98, 98); font-size: 13px; line-height: inherit; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; font-family: Roboto, Arial, Tahoma, sans-serif; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; background-color: rgb(252, 252, 252);\">Menyadari pentingnya langkah dan teori sebelum mengambil potret gambar, tentunya berguna&nbsp; bagi kepentingan-kepentingan digital saat ini seperti konten media sosial, iklan penjualan, dokumentasi kegiatan, dan berbagai kepentingan digital lainnya. Oleh karena itu, Himpunan Mahasiswa Ilmu Komputer Universitas Muhammadiyah Bangka Belitung menjadi wadah untuk memberi pemahaman mengenai permasalahan seputar dalam mengambil potret gambar.<br class=\"Apple-interchange-newline\" style=\"margin: 0px; padding: 0px;\"></p><div><br></div>', '2024-01-08', NULL, 1, 'Seminar-Multimedia', '9ec57fb82008ac9ac920e1e9d58ec146.png', 2),
